import React from 'react';
import { NavLink } from 'react-router-dom';
import '../css/font-awesome.min.css';

const NavBar = () => (
    <footer className="d-flex justify-content-between bg-dark p-3" id="mainFooter">
        <div className="btn-group">
            <NavLink to="/" className="btn btn-outline-primary"><i className="fab fa-angellist"></i></NavLink>
            <NavLink to="/completed" className="btn btn-outline-primary"><i className="fa fa-check-square"></i></NavLink>
            <NavLink to="/add-task" className="btn btn-outline-primary"><i className="fa fa-plus-square"></i></NavLink>
        </div>
        <button className="btn btn-outline-primary"><i className="fa fa-minus-square"></i></button>
    </footer>
)

export default NavBar
